import React from 'react';
import Link from 'next/link';
import styled from 'styled-components';

import Header from '../styles/Header';

const MainDiv = styled.div`
  margin: 30px;
  color: ${({ theme }) => theme.headerWhite};
`;

const HopSelection = () => {
  return (
    <MainDiv>
      <Header />
      <NavigationBar>
        <Title>Starhop</Title>
        <Link href="/about">
          <a>About</a>
        </Link>
      </NavigationBar>
    </MainDiv>
  );
};

export default HopSelection;
